  return (
    <div style={{ backgroundColor: "#AEB4D4", height: "100vh" }}>
      <Container>
        <h5 className="py-3" style={{ textAlign: "right" }}>
          Your Logo
        </h5>
        <div className="d-flex justify-content-center">
          <div>
            <img style={{height:"88vh"}} src={loginimg} alt="" />
          </div>
                  <div>
                      <Loginform/>
          </div>
        </div>
      </Container>
    </div>
  );
};

export default Loginpage;
